import React, { Component } from 'react';
import { ResizableBox } from 'react-resizable';
import { ReactBingmaps } from 'react-bingmaps';
import "../css/resize.css";


class AeroMap extends Component {


    render(){
        let { mapHeight, planeLat, planeLong, mapLat, mapLong, targLat, targLng, zoom, drawPlane, drawTarg } = this.props;
        const planeFigure = drawPlane ? [{
            "center":[planeLat, planeLong],
            "radius": 0.0015,
            "points": 20,
            "option": {fillColor: "#DC143C", strokeThickness: 2}
        }] : [];
        const targFigure = drawTarg ? [{
            "center":[targLat, targLng],
            "radius": 5, // need to figure out how to convert this to feet
            "option": {fillColor: "#ff0000", strokeThickness: 3}
        }] : [];
        console.log(targLat, targLng);
        return (
            <div>
                <ResizableBox
                    width={600}
                    height={mapHeight}
                    axis="x"
                    handleSize={[20, 20]}
                    minConstraints={[100, mapHeight]}
                >
                    <div style={{ backgroundColor: "#999", width: "100%", height: "100%", overflow: "hidden" }}>
                        <ReactBingmaps
                            bingmapKey = "AszsKaHJ3M1aGYwWB85QjTHkpEs8wTow6nOYAzOMDxOCopJSupN6RLCPkbVR42jF"
                            disableStreetside={true}
                            center = {[mapLat, mapLong]}
                            zoom={zoom}
                            regularPolygons = {[planeFigure, targFigure]}
                            //pushPins = {[{"location":[targLat, targLng], "option":{ color: 'red' }, "addHandler": {"type" : "click", callback: this.callBackMethod }}]}
                        />
                    </div>
                </ResizableBox>
            </div>
        );
    }
}

export default AeroMap;
